description:
This is a 6 minute SWF file that centers on the 'Alleged&quot; Boeing 757 Airliner that was supposed to have struck the pentagon building on 9/11. 

There are very few links for this file left on the internet, that I have found, and the only .torrent file I could find has 1 leacher and 0 seeds... I would like to change that and get this out to more people.

